// src/utils/parseCSV.js
import Papa from 'papaparse';

const parseCSV = (file) => {
  return new Promise((resolve, reject) => {
    Papa.parse(file, {
      header: true,
      skipEmptyLines: true,
      complete: (results) => {
        resolve(results.data); // JSON format with header rows as keys
      },
      error: (error) => {
        reject(error);
      },
    });
  });
};

export default parseCSV;
